import React from 'react';


const DisplayEducation = (props) => {
    const {education} = (props);

    return (
            <ul>
                <p>School name</p> 
                <li>{education.school}</li>
                <li>{education.title}</li>
                <li>{education.startDate}</li>
                <li>{education.endDate}</li>
            </ul>
    );
}


export default DisplayEducation;
